import "./App.css";
import Index from "./Pages/Index";
import Login from "./Pages/Login";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/home" element={<Index />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
